import { Link } from "react-router-dom";

export function Navbar() {
  return (
    <div className="NAV">
      <h3>E-COM</h3>
      <ul>
        <li>Home</li>
        <li>User</li>
        <li>Cart</li>
      </ul>
    </div>
  );
}
